import React, { useEffect, useState } from 'react';

import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import { Link,useNavigate } from 'react-router-dom';

import AddEx from './addEx';


const Create = ({formData,setFormData}) => {
    const [type,setType] = useState('Push');
    const [date, setDate] = useState(null);
    const [num,setNum] = useState(10);
    // const [excersises,setExcersises] = useState([])
    const handleTypeChange = (e) => {
        setFormData({ ...formData, type: e.target.value });
    };
    const handleDateChange = (e) => {
        setFormData({ ...formData, date: e.target.value });
    };
    const handleNumChange = (e) => {
        setFormData({ ...formData, num: e.target.value });
    };

 

    const handleSubmit = (e) => {
        e.preventDefault();
        const workout = {type,date,num};
        
        // fetch('http://localhost:8001/workouts',{
        //     method: 'POST',
        //     headers:{"Content-Type": "application/json"},
        //     body:JSON.stringify(workout)
        // }).then(() => {console.log('new workout ');
        //     setIsPending(false);
        //     navigate('/');

        // })
    }

 
    return ( 
        <div className='create'>
            <h2>Add a Workout</h2>  
            <form onSubmit={handleSubmit }>
                <label> Workout Type</label>
                <br />
                    <select
                        required
                        value= {type}
                        onChange={(e) => setType(e.target.value)}>
                        <option value="Push">Push</option>
                        <option value="Pull">Pull</option>
                        <option value="Legs">Legs</option>
                    </select>
                <br />
                <label>Date</label>
                <br />
                    <DatePicker selected={date}
                    onChange={(date) => setDate(date)}
                    required/>

                <br />
                <label>Number of Excersises</label>
                <br />
                    <input 
                    type="number"
                    required
                    value = {num}
                    onChange={(e) => setNum(e.target.value)}/>
                <br />
                <button>
                    <Link to = '/addEx'  >Add Excersises</Link>
                    
                </button>
              
                <br />
                    
                
                
               </form>

        </div>
    );
}
 
export default Create;
